function About() {
  return (
    <div className="pageCard row">
      <div className="petImgHeightHalf pb-2 col-12 col-md-4 order-2">
        <img className="" src="http://placeimg.com/1920/1080/animals"></img>
      </div>
      <div className="pb-2 col-12 col-md-8 order-1">
        <p>
          Pet Friend.ly is a social network for pet lovers. Here you can see a
          lot of content about pets,{" "}
        </p>
      </div>
    </div>
  );
}

export default About;
